        "advice": "<p><strong>暂存区：</strong> 文件已经被提交</p>\n\n<p> <strong>非暂存区：</strong> 变化的文件还没准备被提交</p>\n\n<p> <strong>未追踪的:</strong> 没有被追踪的文件。这通常表示新创建的文件</p>\n\n<p> <strong>删除的：</strong> 已经在Git库中删除的文件和将要从Git库中删除的文件。</p>\n"
