        "advice": "<p><strong>检查所有文件!</strong></p>\n\n<p>当你使用通配符时，你需要更加注意你的某些提交。\n在你真正提交之前，一定要使用\n<code>git status</code>检查文件的状态。这样可以确保\n你提交的东西是正确的。</p>\n"
