        "advice": "<p><strong>更多有用的日志：</strong>\n使用 <code>git log --summary</code> 为每一次的提交查看更多的信息。 你可以\n看到你的文件第一次提交的位置或者删除的位置。这样可以总览整个工程完成的过程。</p>\n"
